import React from "react"

function Recipieslist(props){ 

    const {recipeList} = props

    return ( 
        <div> 
            {recipeList.map((item) => 
            <>
                <h1>{item.title}</h1>
                <img src ={item.image}></img>
                <h4>Ready in{item.readyInMinutes}</h4>
                <h4>{item.servings}</h4>
            </>
                )}

        </div>
    )
}

export default Recipeslist
